jQuery(document).ready(function(){
    jQuery('.atm-network_filters-wrapper .atm-network_dropdown .dropdown-select .btn.dropdown-select-toggle').click(function(){
        const _parentEle = jQuery(this).parent();
        const _listEle = jQuery(_parentEle).find('.dropdown-select-list-wrapper .dropdown-select-list');
        if(_listEle){
            if(jQuery(_listEle).find('.dropdown-select-list__item-wrapper').length > 0){
                checkDropdownDuplicateItems(_listEle);
            }
            else if(jQuery(this).attr('first-click-trigger') == undefined){
                jQuery(this).attr('first-click-trigger', true);
                jQuery(_listEle).addClass('d-none');
                setTimeout(() => {
                    checkDropdownDuplicateItems(_listEle);
                }, 1000);
            }
        }
    });

    function checkDropdownDuplicateItems(_listEle) {
        const _dataList = [];
        jQuery(_listEle).find('.dropdown-select-list__item-wrapper').each(function(){
            const dataApi = jQuery(this).attr('data-api');
            if(dataApi){
                if(_dataList.indexOf(dataApi) >= 0){
                    jQuery(this).css('display','none');
                }
                else{
                    _dataList.push(dataApi);
                }
            }
        });
        jQuery(_listEle).removeClass('d-none');
    }
});